import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

function MyInfo() {
    return (
    <h1>
    John Rendleman
    </h1>
    )
};


ReactDOM.render(
    <MyInfo />,
    document.getElementById("root")
);
